_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1524132","type":"CustomJS"},{"attributes":{"line_alpha":0.1,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0556302964}},"id":"1523942","type":"Line"},{"attributes":{},"id":"1523887","type":"UnionRenderers"},{"attributes":{},"id":"1524099","type":"AllLabels"},{"attributes":{"coordinates":null,"data_source":{"id":"1523940"},"glyph":{"id":"1523941"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1523943"},"nonselection_glyph":{"id":"1523942"},"view":{"id":"1523945"}},"id":"1523944","type":"GlyphRenderer"},{"attributes":{},"id":"1523783","type":"DataRange1d"},{"attributes":{},"id":"1523881","type":"BasicTickFormatter"},{"attributes":{},"id":"1523823","type":"DataRange1d"},{"attributes":{"data":{"datetime":{"__ndarray__":"AACA9Mc0dkIAAMCB5Tp2QgAAgOc3O3ZCAABATYo7dkIAAIB+gTx2QgAAAKZMQnZCAADA0HtGdkIAAACZvEh2QgAAADAGSnZCAADAlVhKdkIAAIApPk12QgAAgMCHTnZCAAAAjCxPdkIAAECCAFR2QgAAwOTuVXZCAACASkFWdkIAAMBAFVt2QgAAAHIMXHZCAABA0ZZfdkIAAEDEBmZ2QgAAgIxHaHZCAADAVIhqdkIAAMCCG212QgAAgK1KcXZCAAAAPsx1dkIAAECdVnl2QgAAgMG9gHZCAAAAjWKBdkIAAEC+WYJ2QgAAwLeRhXZCAAAAFxyJdkIAAMB8bol2QgAAgOLAiXZCAAAAz2iTdkIAAEAAYJR2QgAAQJeplXZCAABALvOWdkIAAICA7aB2QgAAgEXKpHZCAAAA1kupdkIAAMDS56p2QgAAgDg6q3ZCAADAaTGsdkIAAACbKK12QgAAwAB7rXZCAADALg6wdkIAAECR/LF2QgAAQOCSvXZCAAAARuW9dkIAAADdLr92QgAAAHR4wHZCAADAnqfEdkIAAIAE+sR2QgAAgJtDxnZCAABAAZbGdkIAAICOs8x2QgAAQPQFzXZCAACAvEbPdkIAAEAimc92QgAA
